Đà Lạt giờ này vào mùa mưa, mưa từ sáng đến tối nhưng 2 đứa đều rất thích Đà Lạt, mỗi khi muốn đi đâu xa chơi thì đây là địa điểm 2 đứa nghĩ đến đầu tiên. Cảm giác ngồi trong một quán nước nhỏ gần rạp Hòa Bình, nhấp từng ngụm cà phê sữa, nghe những bản nhạc buồn khi ngoài trời đang mưa thì tuyệt vời nhất trên đời. Mỗi chuyến đi chỉ có 2 đứa không bao giờ rủ thêm bất kì một ai vì cảm giác thoải mái không phải chiều lòng hay vướng bận bất cứ điều gì. Muốn ăn gì ăn, muốn ngủ lúc nào ngủ, không đi chơi thì nằm ở khách sạn, thoải mái tự do.

Làm tình không biết bao nhiêu lần rồi, nhưng đây là đầu tiên em mới cho mình chơi lỗ nhị. Mình hỏi lại sao lúc em quen mấy thằng trước thằng nào em cũng cho chơi quá trời còn anh thì không? Thì em nói do lúc đó còn trẻ ham vui còn bây giờ thì thấy chơi cái lỗ đó nó kì kì. Em nói lần đầu bị chơi lỗ nhị do không có kinh nghiệm thằng đó nó trét gel bôi trơn rồi ấn nguyên con cu vào thẳng luôn không kích thích hay làm từ từ gì hết, nó nông muốn tét lỗ nhị mới vô được nguyên con cu xong dập như cái máy khâu. Em kể lúc nó bắn xong rút con cu ra lỗ đít em không khép lại được, mấy ngày sau em vẫn còn rát đến nổi không dám đi vệ sinh. Kể từ lần đó khi nào quan hệ nó cũng chơi lỗ nhị vì nó bót với sướng hơn lỗ kia. Đến mấy thằng sau thằng nào cũng đòi chơi nhưng em hạn chế lắm vì chơi nhiều cơ hậu môn nó bị giãn dễ dẫn đến đi vệ sinh không kiểm soát được.

Sau khi chơi lỗ trước xong, con cu của mình dính đầy nước mà vẫn chưa ra. Nhìn xuống thấy lỗ nhị nhấp nhô khi em thở làm mình chịu không nổi lấy con cu quẹt thêm 1 ít nước trên lỗ trước mình ấn từ từ vào. Phải nói là nó bót khủng khiếp nhấp chừng vài phút chịu hết nổi bắn hết vào trong lỗ đít của em luôn. Nằm tâm sự hỏi em lâu rồi không chơi lỗ nhị có thốn không? Em nói của mình vừa với em nên không thốn lắm chứ em có quen thằng tập gym nó chơi dã man lắm.

